import React, { Component } from 'react';
import classNames from 'classnames';
import './App.css';
import Testdad from './components/Testdad';


class App extends Component {
  constructor (){
    super ();
    this.itemList =[
      // {title : 'tom' , isCheck: true},
      // {title : 'jerry', isCheck: false},
      {title: 'nhieu tien', isCheck: false}];
  }


  render() {
    return (
      <div className="App">
        {
          this.itemList.map((item, index) => (<Testdad key= {index} name = {item} />))
        }
      </div>
    );
  }
}

export default App;
